from numpy import einsum
from numpy.typing import NDArray
from chem.hf.intermediates_builders import Intermediates
from chem.ccsd.uhf_ccsd import UHF_CCSD_Data


def get_lambda_doubles_res_aaaa(
    uhf_scf_data: Intermediates,
    uhf_ccsd_data: UHF_CCSD_Data,
) -> NDArray:
    f_aa = uhf_scf_data.f_aa
    f_bb = uhf_scf_data.f_bb
    g_aaaa = uhf_scf_data.g_aaaa
    g_abab = uhf_scf_data.g_abab
    g_bbbb = uhf_scf_data.g_bbbb
    va = uhf_scf_data.va
    vb = uhf_scf_data.vb
    oa = uhf_scf_data.oa
    ob = uhf_scf_data.ob
    t1_aa = uhf_ccsd_data.t1_aa
    t1_bb = uhf_ccsd_data.t1_bb
    t2_aaaa = uhf_ccsd_data.t2_aaaa
    t2_abab = uhf_ccsd_data.t2_abab
    t2_bbbb = uhf_ccsd_data.t2_bbbb
    if uhf_ccsd_data.lmbda is None:
        raise RuntimeError("Lambda amplitues missing in UHF_CCSD_Data")
    l1_aa = uhf_ccsd_data.lmbda.l1_aa
    l1_bb = uhf_ccsd_data.lmbda.l1_bb
    l2_aaaa = uhf_ccsd_data.lmbda.l2_aaaa
    l2_abab = uhf_ccsd_data.lmbda.l2_abab
    l2_bbbb = uhf_ccsd_data.lmbda.l2_bbbb
    
    contracted_intermediate = -1.00 * einsum('ja,ib->ijba', f_aa[oa, va], l1_aa)
    lambda_doubles_res_aaaa =  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  1.00 * einsum('kk,ijab->ijba', f_aa[oa, oa], l2_aaaa)
    lambda_doubles_res_aaaa +=  1.00 * einsum('kk,ijab->ijba', f_bb[ob, ob], l2_aaaa)
    contracted_intermediate = -1.00 * einsum('jk,ikab->ijba', f_aa[oa, oa], l2_aaaa)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ca,ijcb->ijba', f_aa[va, va], l2_aaaa)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  1.00 * einsum('kc,ck,ijab->ijba', f_aa[oa, va], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00 * einsum('kc,ck,ijab->ijba', f_bb[ob, vb], t1_bb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    contracted_intermediate = -1.00 * einsum('jc,ck,ikab->ijba', f_aa[oa, va], t1_aa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('ka,ck,ijcb->ijba', f_aa[oa, va], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    lambda_doubles_res_aaaa += -0.50 * einsum('lklk,ijab->ijba', g_aaaa[oa, oa, oa, oa], l2_aaaa)
    lambda_doubles_res_aaaa += -0.50 * einsum('lklk,ijab->ijba', g_abab[oa, ob, oa, ob], l2_aaaa)
    lambda_doubles_res_aaaa += -0.50 * einsum('klkl,ijab->ijba', g_abab[oa, ob, oa, ob], l2_aaaa)
    lambda_doubles_res_aaaa += -0.50 * einsum('lklk,ijab->ijba', g_bbbb[ob, ob, ob, ob], l2_aaaa)
    lambda_doubles_res_aaaa +=  1.00 * einsum('ijab->ijba', g_aaaa[oa, oa, va, va])
    contracted_intermediate = -1.00 * einsum('ijak,kb->ijba', g_aaaa[oa, oa, va, oa], l1_aa)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jcab,ic->ijba', g_aaaa[oa, va, va, va], l1_aa)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  0.50 * einsum('ijkl,klab->ijba', g_aaaa[oa, oa, oa, oa], l2_aaaa)
    contracted_intermediate =  1.00 * einsum('jcak,ikcb->ijba', g_aaaa[oa, va, va, oa], l2_aaaa)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jcak,ikbc->ijba', g_abab[oa, vb, va, ob], l2_abab)
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  0.50 * einsum('dcab,ijdc->ijba', g_aaaa[va, va, va, va], l2_aaaa)
    contracted_intermediate =  1.00 * einsum('jkca,ck,ib->ijba', g_aaaa[oa, oa, va, va], t1_aa, l1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jkac,ck,ib->ijba', g_abab[oa, ob, va, vb], t1_bb, l1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ijca,ck,kb->ijba', g_aaaa[oa, oa, va, va], t1_aa, l1_aa, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jkab,ck,ic->ijba', g_aaaa[oa, oa, va, va], t1_aa, l1_aa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlck,cl,ikab->ijba', g_aaaa[oa, oa, va, oa], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jlkc,cl,ikab->ijba', g_abab[oa, ob, oa, vb], t1_bb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  1.00 * einsum('ijcl,ck,klab->ijba', g_aaaa[oa, oa, va, oa], t1_aa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    contracted_intermediate = -1.00 * einsum('jlak,cl,ikcb->ijba', g_aaaa[oa, oa, va, oa], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlak,cl,ikbc->ijba', g_abab[oa, ob, va, ob], t1_bb, l2_abab, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('kcda,dk,ijcb->ijba', g_aaaa[oa, va, va, va], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ckad,dk,ijcb->ijba', g_abab[va, ob, va, vb], t1_bb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jcda,dk,ikcb->ijba', g_aaaa[oa, va, va, va], t1_aa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jcad,dk,ikbc->ijba', g_abab[oa, vb, va, vb], t1_bb, l2_abab, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  1.00 * einsum('kdab,ck,ijdc->ijba', g_aaaa[oa, va, va, va], t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('lkcd,cdlk,ijab->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('lkcd,cdlk,ijab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('klcd,cdkl,ijab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('lkdc,dclk,ijab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('kldc,dckl,ijab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  0.250 * einsum('lkcd,cdlk,ijab->ijba', g_bbbb[ob, ob, vb, vb], t2_bbbb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    contracted_intermediate = -0.50 * einsum('jlcd,cdkl,ikab->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate = -0.50 * einsum('jlcd,cdkl,ikab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate = -0.50 * einsum('jldc,dckl,ikab->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  0.250 * einsum('ijcd,cdkl,klab->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    contracted_intermediate = -0.50 * einsum('lkda,dclk,ijcb->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate = -0.50 * einsum('lkad,cdlk,ijcb->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate = -0.50 * einsum('klad,cdkl,ijcb->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlda,dckl,ikcb->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlda,dclk,ikbc->ijba', g_aaaa[oa, oa, va, va], t2_abab, l2_abab, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlad,cdkl,ikcb->ijba', g_abab[oa, ob, va, vb], t2_abab, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlad,dckl,ikbc->ijba', g_abab[oa, ob, va, vb], t2_bbbb, l2_abab, optimize=['einsum_path', (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate = -0.50 * einsum('ijda,dckl,klcb->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('ijda,dckl,klbc->ijba', g_aaaa[oa, oa, va, va], t2_abab, l2_abab, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('ijda,dclk,lkbc->ijba', g_aaaa[oa, oa, va, va], t2_abab, l2_abab, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    lambda_doubles_res_aaaa +=  0.250 * einsum('lkab,dclk,ijdc->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1)])
    contracted_intermediate = -0.50 * einsum('jlab,dckl,ikdc->ijba', g_aaaa[oa, oa, va, va], t2_aaaa, l2_aaaa, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('jlab,dclk,ikdc->ijba', g_aaaa[oa, oa, va, va], t2_abab, l2_abab, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate =  0.50 * einsum('jlab,cdlk,ikcd->ijba', g_aaaa[oa, oa, va, va], t2_abab, l2_abab, optimize=['einsum_path', (1, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    lambda_doubles_res_aaaa += -0.50 * einsum('lkcd,ck,dl,ijab->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  0.50 * einsum('klcd,ck,dl,ijab->ijba', g_abab[oa, ob, va, vb], t1_aa, t1_bb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  0.50 * einsum('lkdc,ck,dl,ijab->ijba', g_abab[oa, ob, va, vb], t1_bb, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 2), (0, 1)])
    lambda_doubles_res_aaaa += -0.50 * einsum('lkcd,ck,dl,ijab->ijba', g_bbbb[ob, ob, vb, vb], t1_bb, t1_bb, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 2), (0, 1)])
    contracted_intermediate =  1.00 * einsum('jlcd,cl,dk,ikab->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('jldc,cl,dk,ikab->ijba', g_abab[oa, ob, va, vb], t1_bb, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('lkda,cl,dk,ijcb->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 2), (0, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('lkad,cl,dk,ijcb->ijba', g_abab[oa, ob, va, vb], t1_aa, t1_bb, l2_aaaa, optimize=['einsum_path', (0, 2), (0, 2), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->ijab', contracted_intermediate) 
    lambda_doubles_res_aaaa += -0.50 * einsum('ijcd,cl,dk,klab->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (1, 3), (1, 2), (0, 1)])
    contracted_intermediate =  1.00 * einsum('jlda,cl,dk,ikcb->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('jlad,cl,dk,ikbc->ijba', g_abab[oa, ob, va, vb], t1_bb, t1_bb, l2_abab, optimize=['einsum_path', (0, 2), (0, 1), (0, 1)])
    lambda_doubles_res_aaaa +=  1.00000 * contracted_intermediate + -1.00000 * einsum('ijba->jiba', contracted_intermediate)  + -1.00000 * einsum('ijba->ijab', contracted_intermediate)  +  1.00000 * einsum('ijba->jiab', contracted_intermediate) 
    lambda_doubles_res_aaaa += -0.50 * einsum('lkab,cl,dk,ijdc->ijba', g_aaaa[oa, oa, va, va], t1_aa, t1_aa, l2_aaaa, optimize=['einsum_path', (0, 1), (0, 2), (0, 1)])
    return lambda_doubles_res_aaaa


def get_lambda_doubles_res_abab(
    uhf_scf_data: Intermediates,
    uhf_ccsd_data: UHF_CCSD_Data,
) -> NDArray:
    f_aa = uhf_scf_data.f_aa
    f_bb = uhf_scf_data.f_bb
    g_aaaa = uhf_scf_data.g_aaaa
    g_abab = uhf_scf_data.g_abab
    g_bbbb = uhf_scf_data.g_bbbb
    va = uhf_scf_data.va
    vb = uhf_scf_data.vb
    oa = uhf_scf_data.oa
    ob = uhf_scf_data.ob
    t1_aa = uhf_ccsd_data.t1_aa
    t1_bb = uhf_ccsd_data.t1_bb
    t2_aaaa = uhf_ccsd_data.t2_aaaa
