    lambda_doubles_res_baba += -1.00 * einsum('ib,ja->ijba', f_bb[ob, vb], l1_aa)
    lambda_doubles_res_baba += -1.00 * einsum('kk,jiab->ijba', f_aa[oa, oa], l2_abab)
    lambda_doubles_res_baba += -1.00 * einsum('kk,jiab->ijba', f_bb[ob, ob], l2_abab)
